// import './App.css';
import React from "react";
import { Router, Route, Routes, Navigate, BrowserRouter } from "react-router-dom";
import HomePage from './components/home/HomePage.js';
import LoginPage from "./components/login/Login.js";
import SignupPage from "./components/signup/SingupPage.js";
import AuthProvider from "./context/AuthContext.js";

const currentUser = false;

const RequireAuth = ({ children }) => {
  return currentUser ? (children) : <Navigate to="/login" />
}

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Route path="/login" element={<LoginPage />} />
          <Route index element={<RequireAuth><HomePage /></RequireAuth>} />
          <Route path="/Home" element={<RequireAuth><HomePage /></RequireAuth>}></Route>
        </Route>

        <Route path="/singup" element={<SignupPage />}></Route>
      </Routes>
    </BrowserRouter>
  )
}

export default App;
